SELECT MAX("oseba"."upravna_enota") as agg_0, SUM("nesreca"."id_nesreca") as agg_1, MIN("oseba"."strokovni_pregled") as agg_2 FROM "nesreca" LEFT OUTER JOIN "upravna_enota" ON "nesreca"."upravna_enota" = "upravna_enota"."id_upravna_enota" LEFT OUTER JOIN "oseba" ON "nesreca"."id_nesreca" = "oseba"."id_nesreca"  WHERE "oseba"."alkotest" <= 8.939169643187155 AND "nesreca"."y" <= 115629.75168810613